  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake NWR
  outlines Refuge accomplishments from February through April of 1942. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, fish, and disease- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and prescribed burning. Resource management is outlined; topics include
  fur harvesting, cooperative farming, and commercial fishing. The public relations
  section of the report describes Refuge visitors and violations. Photographs are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
